import React from "react";

class Click extends React.Component{
    constructor(){
        super()
        this.state = {
            count : 0,
        }
    }

    clickupdated = () => {
        this.setState({count : this.state.count + 1})
    }
    render(){
        return(
            <div>
                <h1>Items : {this.state.count}</h1>
                <button onClick={this.clickupdated}>ClickHere</button>
            </div>
        )
    }
}

export default Click
